import React from "react";
import { Table } from 'reactstrap';
import styles from './workoutTable.css';


const WorkoutWeekTable = ({workouts}) => {

    const tableStyle = {
        overflowX: 'hidden',
        msOverflowX: 'hidden',
        height: '100%'
    };

    return (
        <Table responsive style={tableStyle}>
            <thead>
            <tr>
                <th>Mo</th>
                <th>Tu</th>
                <th>We</th>
                <th>Th</th>
                <th>Fr</th>
                <th>Sa</th>
                <th>Su</th>
            </tr>
            </thead>
            <tbody>
            <tr>
                {workouts.map(workout => <td key={ workout.id }> { workout.name } </td>)}
            </tr>
            <tr>
                {console.log(workouts)}
                {workouts.map(workout => workout.exercises.forEach(exercise => <td key={ exercise.id }>{ exercise.name }</td>))}
            </tr>
            </tbody>
        </Table>

    )
}

export default WorkoutWeekTable;


